import React, { Component } from 'react';
import { connect } from 'react-redux';
import './SelfDesign.scss';
import { FormattedMessage } from 'react-intl';

import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import SelfDesignImg from "../../../assets/SelfDesign/biotope.jpg"

class SelfDesign extends Component {

    render() {

        let setting = {
            dots: false,
            infiniti: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 2
        }

        return (
            <div className='self-design-section'>
                <div className='section-container'>
                    <div className='section-header'>
                        <span className='title-section'>Bể tự thiết kế</span>
                        <button className='btn-section'>Xem thêm</button>
                    </div>
                    <div className='section-content'>
                        <Slider {...setting}>
                            <div className='section-img'>
                                <div className='img'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                            <div className='section-img'>
                                <div className='img'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                            <div className='section-img'>
                                <div className='img'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                            <div className='section-img'>
                                <div className='img'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                            <div className='section-img'>
                                <div className='img'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                            <div className='section-img'>
                                <div className='img'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                        </Slider>
                    </div>
                </div>
            </div>
        );
    }

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(SelfDesign);
